import './style.css'

export default class Menu extends Component{
    render(){
        return(
            <div className="lista">
                <ul>
                    <li><h3>Teste1</h3></li>
                    <li><p>Teste1</p></li>
                    <li><p>Teste1</p></li>
                    <li><p>Teste1</p></li>
                </ul>
            </div>
        );
    }
}
